import {Card} from 'react-bootstrap';

export class Result extends React.Component {
    render() {
        return (
            <Card>
                <Card.Title>Tomato</Card.Title>
                <Card.Body>Solanum lycopersicum</Card.Body>
            </Card>
        )
    }
}
